import { Component } from "react";

export default class extends React.Component {

  static getServerSideProps


  render() {
    return (
      <>
        <header>Podcasts</header>

        <style jsx>{`
        header {
          color: #fff;
          background: #8756ca;
          padding: 15px;
          text-align: center
        }

       `}</style>
       <style jsx global>{`
       body {
         margin: 0;
         font-family: system-ui;
         background: white;
       }
       `}</style>

      </>
    )
  }
}
